#include <bits/stdc++.h>
// #include <mpi.h>

using namespace std;

const double pi = 3.14159265358979323846;

void init_grid(double x_grid[], double delta, int N, double x_min, double x_max)
{
    x_grid[0] = x_min;

    for (int i = 1; i < N + 1; i++)
    {
        x_grid[i] = x_grid[i - 1] + delta;
    }

    return;
}

int main(int argc, char **argv)
{

    double dx = 0.002;
    double dt = 0.0001;

    double xmin = 0;
    double xmax = 2.0; // L = 2.0
    double T = 1.0;

    int N = int((xmax - xmin) / dx);
    int Nt = int((T - 0.0) / dt);

    double x_grid[N + 1];
    double u_grid_upw[N + 1];
    double u_grid_upw2[N + 1];
    double u_grid_quick[N + 1];
    double u_grid_quick2[N + 1];

    init_grid(x_grid, dx, N, xmin, xmax);

    for (int i = 0; i < N / 4; ++i)
    {
        u_grid_quick[i] = sin(4 * pi * (x_grid[i]));
        u_grid_upw[i] = sin(4 * pi * (x_grid[i]));
        u_grid_quick2[i] = 0.0;
        u_grid_upw2[i] = 0.0;
    }

    for (int i = N / 4; i < N + 1; i++)
    {
        u_grid_quick[i] = 0.0;
        u_grid_upw[i] = 0.0;
        u_grid_quick2[i] = 0.0;
        u_grid_upw2[i] = 0.0;
    }

    for (int j = 0; j < Nt + 1; j++)
    {

        for (int i = 1; i < N; ++i)
        {
            u_grid_upw2[i] = u_grid_upw[i] - dt * ((u_grid_upw[i] - u_grid_upw[i - 1]) / dx);
        }

        u_grid_quick2[1] = u_grid_quick[1] - dt * (u_grid_quick[1] - u_grid_quick[0]) / dx;
        for (int i = 2; i < N; ++i)
        {
            u_grid_quick2[i] = u_grid_quick[i] - dt * ((3.0 * u_grid_quick[i] - 7.0 * u_grid_quick[i - 1] + u_grid_quick[i - 2] + 3.0 * u_grid_quick[i + 1]) / (8.0 * dx));
        }

        for (int i = 0; i < N + 1; i++)
        {
            u_grid_upw[i] = u_grid_upw2[i];
            u_grid_quick[i] = u_grid_quick2[i];
        }

        if (j == (Nt / 2))
        {
            cout << "t=0.5" << endl;
            cout << "upwind - [";
            for (int i = 0; i < N + 1; i++)
            {
                cout << u_grid_upw[i] << ",";
            }
            cout << "]" << endl;
            cout << "quick - [";
            for (int i = 0; i < N + 1; i++)
            {
                cout << u_grid_quick[i] << ",";
            }
            cout << "]" << endl;
        }
    }
    cout << "t=1.0" << endl;
    cout << "upwind - [";
    for (int i = 0; i < N + 1; i++)
    {
        cout << u_grid_upw[i] << ",";
    }
    cout << "]" << endl;

    cout << "quick - [";
    for (int i = 0; i < N + 1; i++)
    {
        cout << u_grid_quick[i] << ",";
    }
    cout << "]" << endl;

    return 0;
}

